def knight_dungeon(m, n, dp):
    if m == 1 and n == 1:
        return 0
    if m == 1 or n == 1:
        return 1
    if dp[m-1][n-1] != -1:
        return dp[m-1][n-1]
    if m == 1:
        return dp[0][n-1] + 1
    if n == 1:
        return dp[m-1][0] + 1
    if m == n:
        return dp[m-1][n-1] + 1
    dp[m-1][n-1] = 1 + max(knight_dungeon(m-1, n, dp), knight_dungeon(m, n-1, dp))
    dp[m-1][n-2] = max(dp[m-1][n-2], dp[m-1][n-1] - 1)
    dp[m-2][n-1] = max(dp[m-2][n-1], dp[m-1][n-1] - 1)
    return dp[m-1][n-1]

