def factorial(n):
    if n == 0:
        return 1
    else:
        return n * factorial(n-1)

def mod(n):
    return n % 1000000007

def comb(n, k):
    return factorial(n) / (factorial(k) * factorial(n-k))

def solve(n, k):
    if k == 0:
        return 1
    elif k == 1:
        return 1
    elif k > n:
        return 0
    else:
        return comb(n, k) * mod(factorial(n-k) * mod(factorial(k)))

