         :type version1: str
         :type version2: str
         :rtype: int
         """
         v1 = list(map(int, version1.split('.')))
         v2 = list(map(int, version2.split('.')))
         while len(v1) < len(v2):
             v1.append(0)
         while len(v2) < len(v1):
