class Solution:
     def insert(self, intervals, newInterval):
         """
         :type intervals: List[List[int]]
         :type newInterval: List[int]
         :rtype: List[List[int]]
         """
         intervals.append(newInterval)
         intervals.sort(key=lambda x: x[0])
         res = []
         for i in intervals:
             if i[0] > res[-1][1]:
                 res.append(i)
             else:
                 res[-1][1] = max(res[-1][1],i[1])
         return res

