    dict = set(dict)
    if start not in dict or end not in dict:
        return 0, -1
    if start == end:
        return 0, 0
    steps = 0
    for i in range(len(start)):
        if start[i] != end[i]:
            break
    for i in range(len(start)):
        if start[i] == end[i]:
            continue
        if start[i] not in dict:
            break
        if start[:i] + end[i+1:] in dict:
            dict.add(start[:i] + end[i+1:])
            dict.add(start[i+1:] + end[:i])
            break
        if start[:i] + end[:i] in dict:
            dict.add(start[:i] + end[:i])
            dict.add(start[i:] + end[:i])
            break
    return dict, steps
