def sieve_of_eratosthenes(n):
    s = [True for i in range(n+1)]
    s[0] = s[1] = False
    for i in range(2, int(n**0.5)+1):
        if s[i]:
            for j in range(i*i, n+1, i):
                s[j] = False
    return [i for i in range(2, n+1) if s[i]]

def find_crossout_point(n, k):
    primes = sieve_of_eratosthenes(n)
    return primes[k-1]

